An event model/object. Should be an Ember Object with two properties. An `event`
property that is the event model.  And a `week` property that is the week that
this event is being displayed on.

  Ember.Object.create({
    event: model,
    week: Ember.Object.create({
      start: startOfWeek,
      end: endOfWeek
    })
  });

The `week` object has 2 properties.  `start` is the start of the week, `end`
is the end of the week.

An array of `Day` objects to display for this week (row) of the calendar.

  ```
  var Day = Ember.Object.extend({
    date: {Integer}, // 1-31
    month: {Integer},// 0-11
    year: {Integer},
    inMonth: true
  });
  ```

There should be 7 days.  1 for each day of the week (starting on monday).

This should be passed into the component.  It should be an Ember.Object with
`date`, `month`, and `year` properties.

  Ember.Object.create({
    date: 31,
    month: 11,
    year: 2014
  });

